import React from 'react';
import './index.css'
import {Avatar} from "antd";



function App() {
  return (
    <div className="App">
        <header className={'index_header'}>
            <div className={'logo'}></div>
            <div className={'search'}></div>
            <div className={'login'}></div>
        </header>
    </div>
  );
}

export default App;
